import React from 'react';
//import './MainPage.css';
import ResponsiveDrawer from "./Nav.jsx"
import {makeStyles} from "@material-ui/core";
import bg from "../images/bg3.png";


const useStyles = makeStyles(theme => ({
    content:{
        flexGrow: 1,
        padding: theme.spacing(3),
        fontSize: 20,
        backgroundImage: `url(${bg})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
        backgroundAttachment: "fixed",
        height: "100%"
    },
    des:{
        color:"white",
        fontFamily:"Comic Sans MS",
        align:'center',
        [theme.breakpoints.up('xs')]: {
            marginLeft: 5,
        },
        [theme.breakpoints.up('sm')]: {
            marginLeft: 250,
        },
        [theme.breakpoints.up('lg')]: {
            marginLeft: 250,
        }

    }

}));



const Project = () => {
    const classes = useStyles();
    return(
        <main className={classes.content}>
            <ResponsiveDrawer/>
            <div className={classes.des}>
                <h2>  Here's what I've done so far. </h2>
                <h2> Education </h2>
                <p>University of Toronto</p>
                <h2> Projects </h2>
                <h3> Web application for partner organization: </h3>
                <p>
                    A web application that help non profit organization, Action Against Hunger Canada,
                    educate and connect students with nutrient science across the world.
                    It's implemented using Angular2, node.js, firebase.
                    This application create a communication platform that engage students with the knowledge of nutrient.
                </p>
                <h3> Research student </h3>
                <p>
                    Development of K-mer Based Alignment-free Pipeline and its database  at Public Health Ontario.
                    designing a database and using PosgreSQL with psycog2 and hash table with chaining, to find the comment subsequence of RNA.
                </p>
                <p>

                </p>
            </div>
        </main>

    );
}

export default Project;
